import React from 'react';
//import Word from "../assets/Word";

class WordTable extends React.Component {

  constructor(props) {
    super(props);
  }
  
  buildWordList = () => {
    return (
        <div>
          {this.props.wordList["wordList"].map(word => 
            {if(this.props.wordList["type"] === "player") {
              <h1>**** - {this.props.wordList["type"]}</h1>   
            } 
            else {
              <h1>{word} - {this.props.wordList["type"]}</h1>   
            }}
          )}
        </div>
      )
  }

  render() {
    return (
      <div style={{ textAlign: "center" }}>
        {this.buildWordList()}
      </div>
    );
  }
}

export default WordTable;
